import { useState } from "react";
import Note from "./Note";

const Left = ({notes, addNewNote}) =>{
    const [seletedId, setSeletedId] = useState(-1);


    return (
        <div className="left">
            <div className="main-title-box">
                <button className="profile-picture-button"></button>
                <button className="my-notes-title">My notes</button>
                <button className="add-new-note">
                    <div className="material-icons" onClick={addNewNote}>note_add</div>
                </button>
            </div>

            <div className="contents">
                <div className="contents-in-search">
                    <div className="search">
                        <div className="material-icons search-icon">search</div>
                    </div>
                    <div>
                        <input className="search-input" id="search" type={"text"} placeholder="Seach all notes"></input>
                    </div>

                </div>
                <div className="contents-in" id="contents-in">
                    {notes.map((note, idx)=>
                        (<Note 
                            className={seletedId===idx?"clicked":""}
                            key={`note-${idx}`}
                        textTitle={note.textTitle} 
                        date={note.date} 
                        text={note.text} 
                        id={note.id}/>))}
                </div>

            </div>

        </div>
    )
};

export default Left;
